import "./App.css";
import { useState } from "React";

function App() {
  return (
    <div id="main">
      <h1> To-Do List</h1>
      <List />
    </div>
  );
}

function List() {
  let toDo = ["laundry", "coding"];

  return (
    <ul>
      {toDo.map((item) => (
        <li key={item}>{item}</li>
      ))}
    </ul>
  );
}

export default App;
